//   fontSize: "14",
//   border: "2px solid rebeccapurple",
// };

// customStyle.color = "blue";
// <h1 style={customStyle}>heading</h1>

var ctime = new Date();
ctime = ctime.getHours();
var greet;
let cstyle = {
  color: "",
  fontSize: "45",
};
if (ctime <= 12) {
  greet = "Good morning";
  cstyle.color = "red";
} else if (ctime <= 18) {
  greet = "Good Afternoon";
  cstyle.color = "green";
} else {
  greet = "Good Night";
  cstyle.color = "blue";
}

ReactDOM.render(
  <div>
    <h1 className="time">Time is {ctime}</h1>
    <p style={cstyle}>{greet}</p>
  </div>,
  document.getElementById("root")
);
